// import logo from "./logo.svg";
import "./App.css";
import Header from "./Header";
import Sidebar from "./Sidebar";
import Contetnt from "./Contetnt";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="container-fluid">
      <div className="col-12">
        <Header />
      </div>
      <div className="row">
        <Sidebar />

        <Contetnt />
      </div>
    </div>
  );
}

export default App;
